function () {
  const users = RandomUser.getUsers().reduce((res, u) => {
    if (!res[u.country]) {
      res[u.country] = 0;
    }
    res[u.country] += 1;
    return res;
  }, {});
  const result = [];
  _.forEach(users, (num, c) => {
    result.push({
      x: c,
      y: num
    });
  });
  return result;
}

